(67, 5, 'Σταφύλι', '&lt;p&gt;grap&lt;/p&gt;', '', 'Σταφύλι', '', ''),
(71, 5, 'Βραζιλιάνικα φυστίκια', '&lt;p&gt;Βραζιλιάνικα φυστίκια&lt;br&gt;&lt;/p&gt;', '', 'Βραζιλιάνικα φυστίκια', '', ''),
(71, 6, 'Brezilya fındığı', '&lt;p&gt;Brezilya fındığı&lt;br&gt;&lt;/p&gt;', '', 'Brazil nuts', '', ''),
(73, 5, 'Pecans', '&lt;p&gt;Pecans&lt;br&gt;&lt;/p&gt;', '', 'Pecans1', '', ''),
(78, 5, 'Πορτοκάλι', 'Το πορτοκαλί φρούτο είναι ένα από τα πιο ευρέως καταναλωμένα φρούτα στις Ηνωμένες Πολιτείες. Είναι μέλος της οικογένειας εσπεριδοειδών μαζί με λεμόνια, λάιμ και γκρέιπφρουτ. Τα πορτοκάλια καλύπτονται συνήθως σε ένα παχύ, πορτοκαλοκίτρινο δέρμα και το εσωτερικό χωρίζεται σε τμήματα ζουμερών πολτών&lt;br&gt;', '', 'Πορτοκάλι', '', ''),
(78, 6, 'Portakal', 'Portakallı meyve, Birleşmiş Devletler\'de en çok tüketilen meyvelerden biridir. Limon, limon ve greyfurt ile birlikte narenciye ailesinin bir üyesidir. Portakal sık sık kalın, orangey-sarı bir deride bulunur ve içerisi sulu selüloz parçalarına bölünür', '', 'Orange', '', ''),
(60, 6, 'zencefil', '&lt;p&gt;Zencefil sebzelerin bir türüdür.&lt;/p&gt;', '', 'Ginger', '', ''),
(193, 3, 'Avocado Organic Box of 48', '', '', 'Avocado Organic Box of 48', '', ''),
(47, 6, ' şeftali', '&lt;p&gt;İş arkadaşlarınızı çarpıcı yeni 30-inç diyagonal HP LP3065 Düz Panel Monitör ile yolda bırakın. Bu amiral gemisi monitörü, geniş bir geniş ekran üzerinde sınıfının en iyisi performans ve sunum özelliklerine sahipken mümkün olduğunca rahat çalışmanıza olanak tanır; hatta ofiste olduğunuzu unutabilirsiniz&lt;/p&gt;\r\n', '', 'peach', '', ''),
(60, 5, 'Τζίντζερ', '&lt;p&gt;Το τζίντζερ είναι ένα είδος λαχανικών.&lt;/p&gt;', '', 'Τζίντζερ', '', ''),
(65, 5, 'Καρότα', '&lt;p&gt;Καρότα&lt;br&gt;&lt;/p&gt;', '', 'Καρότα', '', ''),
(76, 5, 'φράουλα', '&lt;p&gt;φράουλα&lt;/p&gt;', '', 'φράουλα', '', ''),
(57, 3, 'Fruits de la passion', 'Le jus Passion Frutes est une partie importante du petit déjeuner de nombreuses personnes ..', '', 'Passion Frutes', '', ''),
(57, 5, 'Φρούτο του πάθους', '&lt;p&gt;Ο χυμός Passion Frutes είναι ένα σημαντικό μέρος του πρωινού πολλών ανθρώπων&lt;/p&gt;', '', 'Φρούτο του πάθους', '', ''),
(57, 6, 'Çarkıfelek', '&lt;p&gt;\r\nTutku Frides suyu birçok insanın kahvaltısının önemli bir parçasıdır.&lt;/p&gt;', '', 'Passion Frutes', '', ''),
(57, 7, 'Passion Fruit', '&lt;p&gt;Passion Frutes juice is an important part of many people\'s breakfast.&lt;/p&gt;', '', 'Passion Frutes', '', ''),
(54, 5, 'Αγγούρι', '', '', 'Αγγούρι', '', ''),
(68, 5, 'Παξιμάδι 1', 'Το φουντούκι είναι το καρύδι του φουντουκιού και ως εκ τούτου περιλαμβάνει οποιοδήποτε από τα καρύδια που προέρχονται από είδη του γένους Corylus, ειδικά τους καρπούς του είδους Corylus avellana. Είναι επίσης γνωστό ως καρύδι ή καρύδι φίλτρο σύμφωνα με τα είδη.&lt;br&gt;', '', 'Παξιμάδι 1', '', ''),
(69, 6, 'Badem', '&lt;p&gt;Ürünlerimiz Pestisit Kullanılmadan Üretilir Ürünlerimiz, tidalden, yapay gübreden veya kimyasallardan arınmış olarak üretilmiştir ve yapay renk, lezzet veya koruyucu içermediğinden emin olabilirsiniz. Ürünlerimiz Pestisit Kullanılmadan Üretilmektedir. Ürünlerimiz pestisitler, yapay gübreler veya kimyasallar hariç olmak üzere üretilmektedir.&lt;/p&gt;', '', 'Almonds', '', ''),
(69, 5, 'Αμύγδαλα', '&lt;p&gt;Τα προϊόντα μας καλλιεργούνται χωρίς τη χρήση φυτοφαρμάκων Τα προϊόντα μας καλλιεργούνται χωρίς τη χρήση αντισηπτικών, τεχνητών λιπασμάτων ή χημικών ουσιών και έρχονται με τη διασφάλιση ότι δεν υπάρχουν τεχνητά χρώματα, γεύσεις ή συντηρητικά. Τα προϊόντα μας καλλιεργούνται χωρίς τη χρήση φυτοφαρμάκων Τα προϊόντα μας καλλιεργούνται χωρίς τη χρήση φυτοφαρμάκων, τεχνητών λιπασμάτων ή χημικών ουσιών&lt;/p&gt;', '', 'Αμύγδαλα', '', ''),
(56, 5, 'Αρσενικός', '&lt;p&gt;&lt;span id=&quot;result_box&quot; class=&quot;&quot; lang=&quot;el&quot;&gt;&lt;span class=&quot;&quot;&gt;Αρσενικός&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Αρσενικός', '', ''),
(30, 6, 'Mango', '&lt;p&gt;\r\nCanon\'un EOS 5D için hazırladığı basın materyali, &quot;(a) yeni D-SLR kategorisini&quot; tanımlarken, pazarlama konuşmasıyla genellikle fazla ilgilenmiyoruz, ancak bu açıklama açıkça oldukça doğrudur. EOS 5D, bir tam çerçeve (35 mm boyutlu) yüksek çözünürlüklü sensörü (12.8 megapiksel piksel) nispeten kompakt bir gövde ile birleştiren daha önceki herhangi bir dijital SLR\'den farklıdır (EOS 20D\'den biraz daha büyük, elinizde &quot; ) \'chunkier. EOS 5D\'nin EOS 20D ve EOS-1D profesyonel dijital SLR\'leri arasında yer alması hedefleniyor, ikincisine kıyasla önemli bir fark EOS 5D\'nin herhangi bir çevresel mühür içermediğidir. Canon EOS 5D\'yi \'profesyonel\' bir dijital SLR olarak özellikle belirtmese de EOS-1D\'den daha hafif bir gövdede yüksek kaliteli bir dijital SLR isteyen profesyonellere hitap edecek. Şüphesiz şu anki EOS 20D sahiplerine hitap edecektir (ancak çok fazla EF-S lens satın almadığını umalım ...)&lt;/p&gt;\r\n', '', 'Mango', '', ''),
