(30, 5, 'Μάνγκο', '&lt;p&gt;Το υλικό τύπου της Canon για το EOS 5D δηλώνει ότι «ορίζει (α) νέα κατηγορία D-SLR», ενώ δεν είμαστε συνήθως πολύ ενδιαφερόμενοι για το μάρκετινγκ, αυτή η συγκεκριμένη δήλωση είναι σαφώς αρκετά ακριβής. Το EOS 5D είναι σε αντίθεση με οποιοδήποτε προηγούμενο ψηφιακό SLR, καθώς συνδυάζει έναν αισθητήρα υψηλής ανάλυσης (12,8 megapixels) μεγέθους 35 mm με ένα σχετικά συμπαγές σώμα (ελαφρώς μεγαλύτερο από το EOS 20D, αν και στο χέρι σας αισθάνεται αισθητά &quot; chunkier »). Το EOS 5D αποσκοπεί στην υποδοχή μεταξύ των EOS 20D και των επαγγελματικών ψηφιακών SLR της EOS-1D, μια σημαντική διαφορά σε σύγκριση με το τελευταίο είναι ότι το EOS 5D δεν διαθέτει περιβαλλοντικές σφραγίδες. Ενώ η Canon δεν αναφέρεται ειδικά στο EOS 5D ως επαγγελματική ψηφιακή SLR, θα έχει προφανή έκκληση σε επαγγελματίες που θέλουν μια ψηφιακή SLR υψηλής ποιότητας σε ένα σώμα ελαφρύτερο από το EOS-1D. Επίσης, θα προσελκύσει τους σημερινούς ιδιοκτήτες της EOS 20D (αν και αφήνει την ελπίδα ότι δεν έχουν αγοράσει πάρα πολλούς φακούς EF-S ...) äë&lt;/p&gt;\r\n	', '', 'Μάνγκο', '', ''),
