(78, 3, 'Orange', 'Le fruit orange est l\'un des fruits les plus consommés dans les États-Unis. Il est membre de la famille des agrumes avec des citrons, des limes et des pamplemousses. Les oranges sont le plus souvent recouverts d\'une peau épaisse, jaune d\'orange et l\'intérieur est divisé en segments de pulpe juteuse.', '', 'Orange', '', ''),
(30, 7, 'Mango', '&lt;p&gt;\r\n	Canon\'s press material for the EOS 5D states that it \'defines (a) new D-SLR category\', while we\'re not typically too concerned with marketing talk this particular statement is clearly pretty accurate. The EOS 5D is unlike any previous digital SLR in that it combines a full-frame (35 mm sized) high resolution sensor (12.8 megapixels) with a relatively compact body (slightly larger than the EOS 20D, although in your hand it feels noticeably \'chunkier\'). The EOS 5D is aimed to slot in between the EOS 20D and the EOS-1D professional digital SLR\'s, an important difference when compared to the latter is that the EOS 5D doesn\'t have any environmental seals. While Canon don\'t specifically refer to the EOS 5D as a \'professional\' digital SLR it will have obvious appeal to professionals who want a high quality digital SLR in a body lighter than the EOS-1D. It will also no doubt appeal to current EOS 20D owners (although lets hope they\'ve not bought too many EF-S lenses...) äë&lt;/p&gt;\r\n', '', 'Mango', '', ''),
