(84, 3, ' citrons', '&lt;p&gt;Le citron est l\'un des agrumes très faibles en calories. Ce fruit juteux se compose de plusieurs composés bénéfiques pour la santé tels que l\'acide ascorbique, l\'acide citrique, les antioxydants flavonoïdes comme la naringine et l\'hespérétine.&lt;/p&gt;', '', ' citrons', '', ''),
(83, 6, 'Pirinç', '&lt;p&gt;Kişniş yaprakları bir bitki olarak kullanılır ve tohumlar baharat olarak kullanılır. Her ikisi de çeşitli yemeklerde ve pişirme yöntemlerinde kullanılır.&lt;/p&gt;', '', 'Pirinç', '', ''),
(83, 3, 'Riz', '&lt;p&gt;Les feuilles de coriandre sont utilisées comme une herbe et les graines sont utilisées comme épices. Les deux sont utilisés dans une variété de plats et de méthodes de cuisson.&lt;/p&gt;', '', 'Riz', '', ''),
(83, 5, 'Ρύζι', '&lt;p&gt;Τα φύλλα κοριάνων χρησιμοποιούνται ως βότανο και οι σπόροι χρησιμοποιούνται ως μπαχαρικό. Και οι δύο χρησιμοποιούνται σε διάφορα πιάτα και μεθόδους μαγειρέματος.&lt;/p&gt;', '', 'Ρύζι', '', ''),
(83, 7, 'Riso', '&lt;p&gt; Le foglie di coriandolo sono usate come un\'erba e i semi sono usati come spezie. Entrambi sono utilizzati in una varietà di piatti e metodi di cottura.&lt;/p&gt;', '', 'Riso', '', ''),
