(84, 6, 'Limonlar', '&lt;p&gt;Limon çok düşük kalorili narenciye ürünlerinden biridir. Bu sulu meyve askorbik asit, sitrik asit, naringin gibi flavonoid antioksidanlar ve hesperetin gibi sağlık yararlanma özellikli birkaç bileşenden oluşur.&lt;/p&gt;', '', 'Limonlar', '', ''),
(84, 7, 'limoni', '&lt;p&gt;Il limone è uno degli agrumi a bassissimo contenuto calorico. Questo frutto succoso si compone di diversi composti benefici per la salute come l\'acido ascorbico, l\'acido citrico, i flavonoidi antiossidanti come la naringina e l\'esperetina.&lt;/p&gt;', '', 'limoni', '', ''),
(84, 5, 'λεμόνια', '&lt;p&gt;Το λεμόνι είναι ένα από τα πολύ χαμηλών θερμίδων εσπεριδοειδών. Αυτό το χυμώδες φρούτο συνθέτει αρκετές ενώσεις που ωφελούν την υγεία όπως το ασκορβικό οξύ, το κιτρικό οξύ, τα αντιοξειδωτικά φλαβονοειδών όπως η ναριντίνη και η εσκερετίνη.&lt;/p&gt;', '', 'λεμόνια', '', ''),
